- proto: BookBase
  entities:
  - uid: 816
    components:
    - type: MetaData
      desc: Старое, вряд-ли кому нужное руководство.
      name: руководство по эксплуатации шаттла "Капитан Нансен"
    - type: Transform
      rot: 1.5707963267948966 rad
      pos: -4.7006245,-0.4476633
      parent: 1
    - type: Paper
      content: "[italic]большая часть текста руководства неразборчива или неинтересна вам. Кроме следующего текста, однако, некоторые его части грубо отредактированы:\n\n[/italic]-Глава 21-\"Системы управления мостика и рубки, часть вторая\".\n\n---Начнем с рубки: Перед вами будут два кластера кнопок и консоль с доступом к просмотру камер...\n \n[italic]дальше начинается крайне скучная для вас корабельная теория и терминология, которую вы смело пропускаете[/italic]\n\n...Самые дальние, отмеченные жёлто-чёрной окантовкой отвечают за [italic]оригинальный текст грубо зачеркнут[/italic] [bold]корабельные орудия[/bold]\n\nЧуть ближе распологаются кнопки, отвечающие за закрытие и открытие гермозатворов на окнах.\n\nОколо запасной консоли управления слева от вас так-же есть ряд кнопок. Они отвечают за блокировку шлюзов на вход к шаттлу.\nОбратите внимание и на закрытую кнопку с красно-чёрной окантовкой, она предназначена для перевода шаттл в аварийный режим посредством установления болтов на все входные шлюзы шаттла.\n\n---Переходим к Мостику: Перед собой вы видите консоль управления шаттлом... \n[italic]снова пропускаете бесполезные для вас правила безопасного вождения и управления шаттлом в космосе[/italic]\n\nСлева от вас находится панель из семи кнопок: 3 пронумерованных, и 4 без нумерации. Кнопки с нумерацией отвечают за переключение скоростей, кнопка с окантовкой и без номера отвечает за переключение генераторов питания. Оставшиеся 3 кнопки отвечают за систему... [italic]после получения нужной информации у вас пропадает желание дальше читать это педантское руководство"
